import React, { Component } from 'react';
import { Alert, Button, TextInput, View, StyleSheet,Image} from 'react-native';
export default class App extends Component {
constructor(props) {
super(props);
 
this.state = {
username: '',
password: '',
 };
 }
 
onLogin() {
const { username, password } = this.state;
Alert.alert('Credentials', `${username} + ${password}`);
 }
render() {
return (
<View style={styles.container}>
<Image source={{uri: 'https://i.pinimg.com/736x/cc/4c/22/cc4c228e3d69dcd92f7f99b802cb8d24.jpg'}} style={{width: 100, height: 100,marginBottom:'20px'}} />
 
<TextInput
value={this.state.username}
onChangeText={(username) => this.setState({ username })}
placeholder={'Newuser'}
style={styles.input}
/>
<TextInput
value={this.state.password}
onChangeText={(password) => this.setState({ password })}
placeholder={'Password'}
secureTextEntry={true}
style={styles.input}
/>
 
 
<Button color="black" title="Login"
onPress={this.onLogin.bind(this)}
/>
 
<Button color="black" title="Login As Admin"
onPress={this.onLogin.bind(this)}
/>
 
</View>
 );
 }
}
const styles = StyleSheet.create({
container: {
flex: 1,
alignItems: 'center',
justifyContent: 'center',
backgroundColor: '#ecf0f1',
 },
input: {
width: 200,
height: 44,
padding: 10,
borderWidth: 1,
borderColor: 'black',
marginBottom: 10,
}
 })
